    false,nt"url": null,nt"notes": "NCEI Accession 0123694 contains raw underway
    meteorological, navigational, physical and time series data logged by the Scientific
    Computer System (SCS) aboard NOAA Ship Rainier in the Gulf of Alaska from 2014-05-19
    to 2014-09-04. Office of Marine and Aviation Operations (OMAO) personnel aboard
    the ship submitted these data and associated metadata to NCEI. In addition, NCEI
    Accession 0123694 contains supplementary cruise-level metadata, which OMAO personnel
    logged in the Ship Daily Activity Log (SDAL). OMAO and NCEI personnel developed
    the automated process to archive these data under the auspices of the NOAA Rolling
    Deck to Repository (NOAA R2R) program.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
